import React from "react";
import "./App.css";
import Nav from "../components/Nav";
import LandingPage from "../components/LandingPage";

function App() {
  return (
    <div>
      <Nav />
      <br />
      <br />
      <br />
      <br />
      <BrowserRouter>
        <Switch>
          <Route exact path="/"></Route>
          <LandingPage />
        </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
